import React from 'react';
import s from './SimilarPosts.module.css';

const SimilarPosts = ({ posts }) => {
  return (
    <div className={s.similarPostsSection}>
      <h3 className={s.similarTitle}>Похожие объявления</h3>
      <div className={s.postsWrapper}>
        {posts.map((post) => (
          <div key={post.id} className={s.post}>
            <img className={s.postImage} src={post.photo} alt={post.title} />
            <h4 className={s.postTitle}>{post.title}</h4>
            <p className={s.postPrice}>{post.price} грн</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SimilarPosts;
